import React from "react";

const FilterPosts = () => {
  return (
    <>
      <ul className="home__filter-posts">
        <li className="home__select-filter active">New</li>
        <li className="home__select-filter">Popular</li>
      </ul>
    </>
  );
};

export default FilterPosts;
